import React from "react";
import './Home.css';
import bgimg from "../images/Scanner.png";
import { Button } from "react-bootstrap";
import About from "./About";

const Menu = () => {
    return (
        <div className="menu">
            <p>Do not have the filled application form?</p>
            <button onC>Try ChatBot</button>
        </div>
    );
};

export default Menu;
